CREATE SCHEMA IF NOT EXISTS zoo;
USE zoo;

DROP TABLE IF EXISTS adopcion;
CREATE TABLE adopcion (
  id_adopcion int(11) AUTO_INCREMENT PRIMARY KEY,
  img_adopcion longblob NOT NULL,
  edada varchar(50) NOT NULL,
  razaa varchar(50) NOT NULL,
  sexoa varchar(50) NOT NULL
);

DROP TABLE IF EXISTS evento;
CREATE TABLE evento (
  id_evento int(11) AUTO_INCREMENT PRIMARY KEY,
  img_noticia longblob NOT NULL,
  descripcion varchar(50) NOT NULL,
  texto varchar(100) NOT NULL
);

DROP TABLE IF EXISTS imgbanner;
CREATE TABLE imgbanner (
  id_banner int(11) AUTO_INCREMENT PRIMARY KEY,
  imagen longblob NOT NULL
);

DROP TABLE IF EXISTS inscripcion;
CREATE TABLE inscripcion (
  id_inscripcion int(11) AUTO_INCREMENT PRIMARY KEY,
  raza varchar(50) NOT NULL,
  color varchar(50) NOT NULL,
  sexo varchar(50) NOT NULL,
  nombreEjemplar varchar(50) NOT NULL,
  fechaNac varchar(50) NOT NULL,
  lugarNac varchar(50) NOT NULL,
  nRegFcm varchar(50) NOT NULL,
  regTramite varchar(50) NOT NULL,
  nMicrochip varchar(50) NOT NULL,
  mTramite varchar(50) NOT NULL,
  nPadre varchar(50) NOT NULL,
  nMadre varchar(50) NOT NULL,
  nManejador varchar(50) NOT NULL,
  nSocio1 varchar(50) NOT NULL,
  nPropietario varchar(50) NOT NULL,
  nSocio2 varchar(50) NOT NULL,
  domicilio varchar(50) NOT NULL,
  colonia varchar(50) NOT NULL,
  cp varchar(50) NOT NULL,
  ciudad varchar(50) NOT NULL,
  estado varchar(50) NOT NULL,
  email varchar(100) NOT NULL,
  telefono varchar(50) NOT NULL,
  jueves varchar(50) NOT NULL,
  viernes varchar(50) NOT NULL,
  sabado varchar(50) NOT NULL,
  domingo varchar(50) NOT NULL,
  A varchar(50) NOT NULL,
  B varchar(50) NOT NULL,
  j varchar(50) NOT NULL,
  cJ varchar(50) NOT NULL,
  i varchar(50) NOT NULL,
  l varchar(50) NOT NULL,
  cM varchar(50) NOT NULL,
  v varchar(50) NOT NULL,
  c varchar(50) NOT NULL,
  gC varchar(50) NOT NULL,
  p varchar(50) NOT NULL,
  pJ varchar(50) NOT NULL,
  cD varchar(50) NOT NULL,
  e varchar(50) NOT NULL
);

DROP TABLE IF EXISTS mascota_perdida;
CREATE TABLE mascota_perdida (
  id_mascota int(11) AUTO_INCREMENT PRIMARY KEY,
  img_mascota longblob NOT NULL,
  nombre varchar(50) NOT NULL,
  edadp varchar(50) NOT NULL,
  razap varchar(50) NOT NULL,
  sexo varchar(50) NOT NULL,
  telefono varchar(50) NOT NULL,
  ubicacion varchar(50) NOT NULL,
  dueno varchar(50) NOT NULL,
  datos text NOT NULL
);

DROP TABLE IF EXISTS usuario;
CREATE TABLE usuario (
  id_usuario int(11) AUTO_INCREMENT PRIMARY KEY,
  usuario varchar(100) NOT NULL,
  password varchar(100) NOT NULL
);


